import React from 'react';
import ProjectCard from './ProjectCard';
import places2be from '../assets/places2be.png';
import noimage from '../assets/noimage.png';
import nyu from '../assets/nyu.png';

const Projects = () => {
    return (
       <div style={{width: '100%', gap: '20px'}}>
            <ProjectCard name="places2be" photoUrl={places2be} demoLink = 'https://www.youtube.com/watch?v=xZwKXef8rUE' description="places2be is a platform that helps users discover and explore interesting locations. It provides information on various places, including photos, descriptions, and user reviews. The app aims to make it easier for people to find new destinations to visit and share their experiences with others."/>
            <ProjectCard name="Farmers Retreat Website" photoUrl={noimage} description="Hi"/>
            <ProjectCard name="NYU Holodeck: High Speed Research Network" photoUrl={nyu} description="Hi"/>
       </div>
    );
};

export default Projects;
